package busstops

import (
	"encoding/json"
	"fmt"
	"testing"
)

func TestStore(t *testing.T) {
	store := NewStore("properties_BUS_STOP_N")  // the index for the new store.. you can define as many as you want
	everything := &FeatureCollection{}          // unmarshal the whole file to get the collection
	err := json.Unmarshal(testData, everything) //
	if err != nil {
		t.Fatal(err)
	}

	for _, feature := range everything.Features { // unmarshal properties one by one and add them to the store
		m := map[string]interface{}{}
		err := json.Unmarshal(feature, &m)
		if err != nil {
			t.Fatal(err)
		}
		store.Add(m)
	}

	someValue, ok := store.Get("properties_BUS_STOP_N", "06159") // try to retrieve one entry from the store
	if !ok {
		t.Fail()
	}

	fmt.Println(someValue)
}

